import React from "react";
import "./style.css";

const Search = (props) => {
    
    function handleSubmit(e){
        e.preventDefault();
        console.log("subbed");
    }

    return (
        <form className="search-form" onSubmit={handleSubmit}>
            <input
                type="text" 
                className="search__input" 
                placeholder="Search for a book." 
            />
        </form>
    );
}

export default Search;
